import React from "react";
import {BrowserRouter} from "react-router-dom";
import {Input} from "antd";

class Article extends React.Component {
    render() {
        return (
            <BrowserRouter>
                <div>
                    <Input.Group compact/>
                </div>
            </BrowserRouter>
        )
    }
}

export default Article;
